  return (
    <div className="rec">
      <img src="../images/recovery/shield.svg" className="rec__logo" />
      <span className="rec__title">Восстановление</span>
      <span className="rec__subtitle">Что вы хотите восстановить?</span>
    </div>
  );
}

export default RecChoise;
